import base64
import io
from PIL import Image

#define icons
rgb_icon_b64 = ""
quant_icon_b64 = ""
file_icon_b64 = ""
edit_icon_b64 = ""

#function to decode icons and return image
def decode_icon(icon_string):
    decoded_string = io.BytesIO(base64.b64decode(icon_string))
    icon_image = Image.open(decoded_string)

    return icon_image